import React from 'react';

export interface TableHeadingProps {
  className: any;
  children: any;
}

const TableHeading: React.SFC<TableHeadingProps> = ({
  className,
  children,
}) => {
  return (
    <th scope="col" className={className ? `${className}` : null}>
      {children}
    </th>
  );
};

export default TableHeading;
